gQr(){return"Wir unterst\xfctzen Sie gern beratend, um die beste Technologie f\xfcr einen Problemfall auszuw\xe4hlen, Softwareprodukte zu evaluieren oder diese optimal in Ihre bestehende IT-Infrastruktur zu integrieren."},
gQs(){return"Beratung zu Auswahl und Einsatz von Technologien und Produkten"},
gQt(){return"Wir beraten Sie bei gern bei der Auswahl und Anwendung von Technologien und Produkten. Schwerpunkt-Themen sind die Anwendung der Eclipse Rich Client Platform (RCP), Google Web Toolkit, Web Services, Drupal und PLM Services, ebenso die Entwicklung robuster Anwendungstests f\xfcr Eclipse-basierte Anwendungen"},
gUO(){return"Portierung von Anwendungen auf die Eclipse RCP-Plattform"},
gUP(){return"Sie planen Ihre Java/Swing-Anwendungen auf die Eclipse Rich Client Platform (RCP) zu portieren und brauchen Unterst\xfctzung bei der Entwicklung des optimalen Umsetzungskonzepts? Mit unserer langj\xe4hrigen Erfahrung in der Anwendungsentwicklung mit Java, Swing und Eclipse RCP k\xf6nnen wir Sie bei der Planung und Umsetzung dieses Projekts unterst\xfctzen."},
gIz(){return"Software-Anwendungsentwicklung"},
gIA(){return"Die Entwicklung von Anwendungssoftware ist unsere Spezialdisziplin. Wir entwickeln Software f\xfcr Sie oder verst\xe4rken Ihr Entwicklerteam in Ihren Projekten mit unseren Spezialisten."},
gPI(){return"Anwendungen f\xfcr das Android OS"},
gPJ(){return"Android ist ein modernes Betriebssystem f\xfcr mobile Endger\xe4te und wird von der Open Handset Alliance entwickelt. Es basiert auf dem Linux-Betriebssystem, Anwendungen (Apps) werden in der Java-Programmiersprache erstellt. Android hat seit seinem Erscheinen Anfang 2009 einen riesigen Marjkt erschlossen und ist heute auf Smartphones, Mobiltelefonen, Netbooks und Tablet-PCs zuhause.Wir entwickeln Anwendungen f\xfcr das Android OS oder portieren Ihre vorhandenen Anwendungen von anderen Plattformen nach Android."},
gR5(){return"Entwicklung kundenspezifischer Softwareanwendungen"},
gR6(){return"In unseren Projekten setzen wir vorwiegend Java als Programmiersprache ein und nutzen Java-Programmierbibliotheken und -Standards. So bieten wir Entwicklung von\n- Anwendungen auf Basis von Java Swing und Eclipse RCP\n- Client- und Serverkomponenten f\xfcr Web Services\n- Webanwendungen auf Basis des Google Web Toolkit (GWT)\n\nPartMaster wendet bei der Anwendungsentwicklung konsequent agile Methodiken an, so k\xf6nnen Sie als Kunde den Entwicklungsprozess kontinuierlich begleiten und mit gestalten. Sie erhalten fr\xfchzeitig erste Software-Versionen, die Sie an Ihren Anforderungen pr\xfcfen und den weiteren Entwicklungsprozess steuern k\xf6nnen. Sie wird gew\xe4hrleistet, dass Sie am Fertigstellungstermin genau die Software erhalten, die Ihre Anforderungen bestm\xf6glich abdeckt und Ihre Erwartungen optimal erf\xfcllt."},
gDG(){return"Wir entwickeln <em>IT-Strategien</em>, erarbeiten <em>Kriterien</em> f\xfcr den Einsatz und die Auswahl von Technologien und Produkten, erstellen <em>Softwarekomponenten</em> und integrieren diese in bestehende <em>IT-Architekturen</em>. Als kleines, technologieorientiertes Unternehmen \xfcbernehmen wir f\xfcr unsere Kunden die Rolle des <em>Gestalters, Vermittlers und Br\xfcckenbauers</em> um Chancen f\xfcr unsere Kunden nutzbar zu machen, die sich durch neue Technologien bieten.\n\nUnser Ziel ist es, die abzuwickelnden Vorg\xe4nge des Kunden optimal durch eine <em>intuitiv bedienbare Software</em> zu begleiten und dabei die <em>Kreativit\xe4t</em>, die <em>Individualit\xe4t</em> und die M\xf6glichkeiten der <em>Selbstorganisation</em> der Mitarbeiter nicht einzuschr\xe4nken, sondern zu erweitern. Durchgef\xfchrte Arbeiten m\xfcnden <em>schnell</em> in <em>konkreten Ergebnissen</em>, was f\xfcr den Kunden <em>Planungssicherheit</em> und <em>Investitionssicherheit</em> gew\xe4hrleistet."},
gPN(){return"Die Anreise mit dem PKW ist nat\xfcrlich aus verschiedenen Richtungen m\xf6glich. In unmittelbarere N\xe4he unserer B\xfcror\xe4ume befindet sich das City-Parkhaus in der Langen Stra\xdfe, in dem Sie Ihr Auto bequem abstellen k\xf6nnen. Aus dem Parkhaus kommend, wenden Sie sich bitte nach rechts, gehen einige Meter geradeaus und biegen nach links in die Lagerstra\xdfe ein. Der Eingang zu unseren B\xfcros befindet sich gleich hier im Hofbereich."},
gPP(){return"Vom Rostocker Hauptbahnhof kommen Sie direkt mit der Stra\xdfenbahn in die Innenstadt. Hier benutzen Sie die Bahnen in Richtung City. An der Haltestelle 'Neuer Markt' steigen Sie aus und folgen dem Verlauf der Stra\xdfenbahnschienen, vorbei an der Marienkirche. An der n\xe4chsten Ampel \xfcberqueren Sie die Stra\xdfenbahnschienen ('Lange Stra\xdfe'). Folgen Sie dann dem Verlauf der Langen Stra\xdfe einige Meter bis Sie rechts einen gro\xdfen Torbogen-Eingang sehen. Diesen Eingang gehen sie hindurch, die Treppe hinunter und wenden sich nach rechts. Sie gehen etwa 10 Meter geradeaus und biegen dann wieder links ab. Hier \xfcber diesen Innenhof erreichen Sie unsere B\xfcros."},
gHp(){return"Allgemeines"},
gHq(){return"Die Betreiber dieser Seiten nehmen den Schutz Ihrer pers\xf6nlichen Daten sehr ernst. Wir behandeln Ihre personenbezogenen Daten vertraulich und entsprechend der gesetzlichen Datenschutzvorschriften sowie dieser Datenschutzerkl\xe4rung."},
gU8(){return"Name und Anschrift des Verantwortlichen"},
gU9(){return"Der Verantwortliche im Sinne der Datenschutz-Grundverordnung und anderer nationaler Datenschutzgesetze der Mitgliedsstaaten sowie sonstiger datenschutzrechtlicher Bestimmungen ist:\n\nPartMaster GmbH\nSteffen Nowacki\nLagerstra\xdfe 44/45\n18055 Rostock\n\nTelefon: +49 381-20373995\nE-Mail: info@partmaster.de\nWebsite: https://www.partmaster.de"},
gUW(){return"Wir verarbeiten personenbezogene Daten unserer Nutzer grunds\xe4tzlich nur, soweit dies zur Bereitstellung einer funktionsf\xe4higen Website sowie unserer Inhalte und Leistungen erforderlich ist. Die Verarbeitung personenbezogener Daten unserer Nutzer erfolgt regelm\xe4\xdfig nur nach Einwilligung des Nutzers. Eine Ausnahme gilt in solchen F\xe4llen, in denen das vorherige Einholen einer Einwilligung aus tats\xe4chlichen Gr\xfcnden nicht m\xf6glich ist und die Verarbeitung der Daten durch gesetzliche Vorschriften gestattet ist.\n\nDie Nutzung unserer Website ist in der Regel ohne Angabe personenbezogener Daten m\xf6glich. Soweit auf unseren Seiten personenbezogene Daten (beispielsweise Name, Anschrift oder E-Mail-Adressen) erhoben werden, erfolgt dies, soweit m\xf6glich, stets auf freiwilliger Basis. Diese Daten werden ohne Ihre ausdr\xfcckliche Zustimmung nicht an Dritte weitergegeben.\n\nWir weisen darauf hin, dass die Daten\xfcbertragung im Internet (z.B. bei der Kommunikation per E-Mail) Sicherheitsl\xfccken aufweisen kann. Ein l\xfcckenloser Schutz der Daten vor dem Zugriff durch Dritte ist nicht m\xf6glich."},
gIH(){return"SSL-Verschl\xfcsselung"},
gII(){return"Diese Seite nutzt aus Gr\xfcnden der Sicherheit und zum Schutz der \xdcbertragung vertraulicher Inhalte, wie zum Beispiel der Anfragen, die Sie an uns als Seitenbetreiber senden, eine SSL-Verschl\xfcsselung. Eine verschl\xfcsselte Verbindung erkennen Sie daran, dass die Adresszeile des Browsers von \u201chttp://\u201d auf \u201chttps://\u201d wechselt und an dem Schloss-Symbol in Ihrer Browserzeile.\n\nWenn die SSL Verschl\xfcsselung aktiviert ist, k\xf6nnen die Daten, die Sie an uns \xfcbermitteln, nicht von Dritten mitgelesen werden."},
gVC(){return"Recht auf Auskunft, L\xf6schung, Sperrung"},
